import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar';

function App() {
  return (
    <div className="App">
    <Navbar />
    {/* Your portfolio content here */}
    <section id="home">
      <h1>Welcome to My Portfolio</h1>
      {/* More sections like About, Projects, Contact */}
    </section>
  </div>
  );
}

export default App;
